import React from "react";

function CreateGame(){

    return(
        <div id="createNewGame">
            <input id="newTitle" type="text">Game Title</input>
            <input id="newYear" type="text"></input>
            <input id="newReview" type="text"></input>
            <input id="newImg_URL" type="text"></input>
            <select id="newGenre"></select>
            <select id="newPlatform"></select>
        </div>
    )

}

export default CreateGame
